import React, { useEffect, useState } from "react";
import { useParams, useNavigate } from "react-router-dom";
import "./ResultPage.css";

export default function ResultPage({ onLogout }) {
  const { submissionId } = useParams();
  const [result, setResult] = useState(null);
  const [faceLogs, setFaceLogs] = useState([]);
  const [verificationLogs, setVerificationLogs] = useState([]);
  const [mobileLogs, setMobileLogs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  // --- Handler: Go to Dashboard ---
  const handleGoToDashboard = () => {
    const userData = JSON.parse(localStorage.getItem("user"));
    if (userData?.role === "student") navigate("/student/dashboard");
    else if (userData?.role === "admin") navigate("/admin/dashboard");
    else navigate("/");
  };

  // --- Handler: Logout ---
  const handleLogoutAndGoHome = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("user");
    localStorage.removeItem("name");

    if (onLogout) onLogout();
    alert("‚úÖ You have been logged out successfully!");
    navigate("/");
    window.location.reload();
  };

  useEffect(() => {
    const fetchResult = async () => {
      try {
        const token = localStorage.getItem("token");
        if (!token) {
          setError("No authentication token found. Please login.");
          setLoading(false);
          return;
        }

        console.log("üìä Fetching result for submission:", submissionId);

        // Fetch exam result
        const response = await fetch(
          `http://localhost:4000/api/exam/result/${submissionId}`,
          { headers: { Authorization: `Bearer ${token}` } }
        );

        if (!response.ok) throw new Error(`Failed to fetch result: ${response.status}`);
        const data = await response.json();
        setResult(data);

        console.log("‚úÖ Result data:", data);
        console.log("üìã User ID:", data.userId);
        console.log("üìã Exam ID:", data.examId);

        // Fetch proctoring logs ONLY for this specific exam
        if (data.userId && data.examId) {
          try {
            // Fetch multiple face detection logs
            console.log("üîç Fetching face logs for:", data.userId, data.examId);
            const faceRes = await fetch(
              `http://localhost:4000/api/exam/face-logs/${data.userId}/${data.examId}`,
              { headers: { Authorization: `Bearer ${token}` } }
            );

            if (faceRes.ok) {
              const faceData = await faceRes.json();
              console.log("‚úÖ Face logs received:", faceData.faceLogs?.length || 0);
              setFaceLogs(faceData.faceLogs || []);
            }

            // Fetch face verification logs
            console.log("üîç Fetching verification logs for:", data.userId, data.examId);
            const verifyRes = await fetch(
              `http://localhost:4000/api/exam/face-verification-logs/${data.userId}/${data.examId}`,
              { headers: { Authorization: `Bearer ${token}` } }
            );

            if (verifyRes.ok) {
              const verifyData = await verifyRes.json();
              console.log("‚úÖ Verification logs received:", verifyData.verificationLogs?.length || 0);
              setVerificationLogs(verifyData.verificationLogs || []);
            }

            // Fetch mobile detection logs
            console.log("üîç Fetching mobile logs for:", data.userId, data.examId);
            const mobileRes = await fetch(
              `http://localhost:4000/api/exam/mobile-detection-logs/${data.userId}/${data.examId}`,
              { headers: { Authorization: `Bearer ${token}` } }
            );

            if (mobileRes.ok) {
              const mobileData = await mobileRes.json();
              console.log("‚úÖ Mobile logs received:", mobileData.mobileLogs?.length || 0);
              setMobileLogs(mobileData.mobileLogs || []);
            }
          } catch (logError) {
            console.warn("Could not fetch proctoring logs:", logError);
          }
        } else {
          console.warn("‚ö†Ô∏è Missing userId or examId, cannot fetch logs");
        }

        setLoading(false);
      } catch (error) {
        console.error("‚ùå Error fetching result:", error);
        setError(error.message);
        setLoading(false);
      }
    };

    fetchResult();
  }, [submissionId]);

  // --- Render loading ---
  if (loading) {
    return (
      <div className="result-loading">
        <div className="loading-spinner"></div>
        <h3>Loading your results...</h3>
      </div>
    );
  }

  // --- Render error ---
  if (error) {
    return (
      <div className="container" style={{ padding: "2rem", textAlign: "center" }}>
        <h3 style={{ color: "red" }}>‚ùå Error</h3>
        <p>{error}</p>
        <button onClick={handleLogoutAndGoHome} className="btn">
          Go to Login
        </button>
      </div>
    );
  }

  // --- Render no result ---
  if (!result) {
    return (
      <div className="container" style={{ padding: "2rem", textAlign: "center" }}>
        <h3>No result found</h3>
        <button onClick={handleLogoutAndGoHome} className="btn">
          Go to Login
        </button>
      </div>
    );
  }

  // --- Render success ---
  const percentage = ((result.score / result.totalQuestions) * 100).toFixed(1);
  const isPassed = percentage >= 60;

  // Count failed verifications
  const failedVerifications = verificationLogs.filter(
    log => log.verificationStatus === 'failed' || log.verificationStatus === 'no_face'
  ).length;

  const mobileDetections = mobileLogs.filter(
    log => log.detectionType === 'phone_detected'
  ).length;

  return (
    <div className="result-container">
      <div className="result-header">
        <h2>üìä Exam Results</h2>
        <p style={{ fontSize: '0.9rem', color: '#6b7280', marginTop: '0.5rem' }}>
          Submission ID: {submissionId}
        </p>
      </div>

      <div className="result-score-card">
        <div className="result-score-display">
          {result.score}/{result.totalQuestions}
        </div>
        <div className="result-score-detail">Questions Answered</div>
        <div className="result-percentage">{percentage}%</div>
        <div className={`result-pass-badge ${isPassed ? "passed" : "failed"}`}>
          {isPassed ? "‚úÖ Passed" : "‚ùå Failed"}
        </div>
      </div>

      {/* Proctoring Summary */}
      {(faceLogs.length > 0 || verificationLogs.length > 0 || mobileLogs.length > 0) && (
        <div className="result-proctoring-summary">
          <h3>üîí Proctoring Summary</h3>
          <div className="proctoring-stats">
            <div className="proctoring-stat-item">
              <span className="stat-icon">üë•</span>
              <span className="stat-label">Multiple Faces Detected:</span>
              <span className="stat-value">{faceLogs.length}</span>
            </div>
            <div className="proctoring-stat-item">
              <span className="stat-icon">üö®</span>
              <span className="stat-label">Identity Verification Failures:</span>
              <span className="stat-value">{failedVerifications}</span>
            </div>
            <div className="proctoring-stat-item">
              <span className="stat-icon">üì±</span>
              <span className="stat-label">Mobile Phone Detections:</span>
              <span className="stat-value">{mobileDetections}</span>
            </div>
          </div>
        </div>
      )}

      <div className="result-section">
        <h3>üìù Question Review</h3>
        {result.questions.map((q, i) => {
          const userAnswerIndex = result.answers[i];
          const isCorrect = userAnswerIndex === q.correctOption;

          return (
            <div
              key={i}
              className={`result-question-item ${isCorrect ? "correct" : "incorrect"}`}
            >
              <div className="result-question-number">Question {i + 1}</div>
              <div className="result-question-text">{q.text}</div>

              <div className="result-answer-row">
                <div className="result-answer-item">
                  <span className="result-answer-label">Your Answer:</span>
                  <span
                    className={`result-answer-value ${
                      isCorrect ? "correct-answer" : "wrong-answer"
                    }`}
                  >
                    {q.options[userAnswerIndex] || "Not Answered"}
                  </span>
                </div>

                <div className="result-answer-item">
                  <span className="result-answer-label">Correct Answer:</span>
                  <span className="result-answer-value correct-answer">
                    {q.options[q.correctOption]}
                  </span>
                </div>
              </div>

              <span className="result-status-icon">{isCorrect ? "‚úÖ" : "‚ùå"}</span>
            </div>
          );
        })}
      </div>

      {/* Detailed Proctoring Logs */}
      {(faceLogs.length > 0 || verificationLogs.length > 0 || mobileLogs.length > 0) && (
        <div className="result-proctoring-section">
          <h3>üëÄ Detailed Proctoring Report</h3>
          
          {/* Multiple Face Detection Logs */}
          {faceLogs.length > 0 && (
            <div className="proctoring-log-section">
              <h4>üë• Multiple Face Detections ({faceLogs.length})</h4>
              <ul className="result-face-logs-list">
                {faceLogs.map((log, index) => (
                  <li key={index} className="result-face-log-item">
                    <span className="result-face-log-time">
                      {new Date(log.timestamp).toLocaleString()}
                    </span>
                    {" - "}{log.details || "Multiple faces detected"}
                  </li>
                ))}
              </ul>
            </div>
          )}

          {/* Identity Verification Logs */}
          {verificationLogs.length > 0 && (
            <div className="proctoring-log-section">
              <h4>üîç Identity Verification Events ({verificationLogs.length})</h4>
              <ul className="result-face-logs-list">
                {verificationLogs
                  .filter(log => log.verificationStatus === 'failed' || log.verificationStatus === 'no_face')
                  .map((log, index) => (
                    <li key={index} className="result-face-log-item warning">
                      <span className="result-face-log-time">
                        {new Date(log.timestamp).toLocaleString()}
                      </span>
                      {" - "}
                      {log.verificationStatus === 'no_face' ? 
                        "No face detected" : 
                        `Identity mismatch (${(log.confidence * 100).toFixed(1)}% confidence)`
                      }
                      {log.details && ` - ${log.details}`}
                    </li>
                  ))}
              </ul>
              {failedVerifications === 0 && (
                <p style={{ color: '#059669', fontSize: '0.9rem', marginTop: '0.5rem' }}>
                  ‚úÖ No verification failures detected
                </p>
              )}
            </div>
          )}

          {/* Mobile Detection Logs */}
          {mobileLogs.length > 0 && (
            <div className="proctoring-log-section">
              <h4>üì± Mobile Phone Detections ({mobileDetections})</h4>
              <ul className="result-face-logs-list">
                {mobileLogs
                  .filter(log => log.detectionType === 'phone_detected')
                  .map((log, index) => (
                    <li key={index} className="result-face-log-item critical">
                      <span className="result-face-log-time">
                        {new Date(log.timestamp).toLocaleString()}
                      </span>
                      {" - "}
                      Mobile phone detected ({(log.confidence * 100).toFixed(1)}% confidence)
                      {log.actionTaken && ` - Action: ${log.actionTaken}`}
                    </li>
                  ))}
              </ul>
              {mobileDetections === 0 && (
                <p style={{ color: '#059669', fontSize: '0.9rem', marginTop: '0.5rem' }}>
                  ‚úÖ No mobile phone detections
                </p>
              )}
            </div>
          )}
        </div>
      )}

      {(faceLogs.length === 0 && verificationLogs.length === 0 && mobileLogs.length === 0) && (
        <div className="result-proctoring-section">
          <h3>üëÄ Proctoring Report</h3>
          <p style={{ color: '#059669', textAlign: 'center', padding: '2rem' }}>
            ‚úÖ No proctoring issues detected during this exam
          </p>
        </div>
      )}

      <div className="result-actions">
        <button
          onClick={handleGoToDashboard}
          className="result-btn result-btn-secondary"
        >
          üè† Return to Dashboard
        </button>

        <button
          onClick={handleLogoutAndGoHome}
          className="result-btn result-btn-primary"
        >
          üîì Logout & Return to Login
        </button>
      </div>
    </div>
  );
}
